import React from "react";

const headerStyle = {
  color: '#f3be85',
  padding: '20px',
  display: 'flex',
  justifyContent: 'space-between'
}


const Header = () => {
  return (
    <div>
      <style jsx>{`
          .header {
             color: #f3be85,
             padding: 20px,
             display: flex,
             justifyContent: space-between
          }
          ul {
            color: black;
          }

           ul li a {
              text-decoration: none;
            }


      `}</style>
      <header className="header" style={headerStyle}>

        <h1>ViajaEnVan</h1>
        <ul>
          <li>Inicio</li>
          <li>Destinos</li>
          <li>Servicios</li>
          <li>Cotactenos</li>
        </ul>
      </header>
    </div>
  );
};

export default Header;
